const CLIENT_ID = '63b30b7a91534d6fa0184a9e67fa1518'; // Replace with your Spotify client ID
const CLIENT_SECRET = '0794337a71774f3aba15fa10e9ff0850'; // Replace with your Spotify client secret

// Step 1: Get an Access Token
async function getAccessToken() {
    const response = await fetch('https://accounts.spotify.com/api/token', {
        method: 'POST',
        headers: {
            'Content-Type': 'application/x-www-form-urlencoded',
            Authorization: 'Basic ' + Buffer.from(`${CLIENT_ID}:${CLIENT_SECRET}`).toString('base64'),
        },
        body: 'grant_type=client_credentials',
    });
    const data = await response.json();
    return data.access_token;
}

// Step 2: Get Artist's Top Tracks
async function getArtistTopTracks(artistId, accessToken) {
    const response = await fetch(`https://api.spotify.com/v1/artists/${artistId}/top-tracks?market=US`, {
        headers: {
            Authorization: `Bearer ${accessToken}`,
        },
    });
    const data = await response.json();
    return data.tracks;
}

// Step 3: Get Audio Features for Tracks
async function getAudioFeaturesForTracks(trackIds, accessToken) {
    const response = await fetch(`https://api.spotify.com/v1/audio-features?ids=${trackIds.join(',')}`, {
        headers: {
            Authorization: `Bearer ${accessToken}`,
        },
    });
    const data = await response.json();
    return data.audio_features;
}


// Step 4: Main Function to Fetch All Data for Multiple Artists
async function fetchArtistsData(artistIds) {
    try {
        const accessToken = await getAccessToken();
        let combinedData = [];

        for (const artistId of artistIds) {
            console.log(`Fetching data for artist ID: ${artistId}`);
            
            // Get Top Tracks
            const topTracks = await getArtistTopTracks(artistId, accessToken);
            const trackIds = topTracks.map(track => track.id);

            // Get Audio Features
            const audioFeatures = await getAudioFeaturesForTracks(trackIds, accessToken);

            // Combine Track Data and Audio Features
            const artistData = topTracks.map(track => {
                const features = audioFeatures.find(feature => feature.id === track.id);
                return {
                    artistName: track.artists[0]?.name,
                    trackName: track.name,
                    albumName: track.album.name,
                    durationMs: track.duration_ms,
                    popularity: track.popularity,
                    explicit: track.explicit,
                    danceability: features?.danceability || null,
                    energy: features?.energy || null,
                    acousticness: features?.acousticness || null,
                    instrumentalness: features?.instrumentalness || null,
                    liveness: features?.liveness || null,
                    loudness: features?.loudness || null,
                    speechiness: features?.speechiness || null,
                    tempo: features?.tempo || null,
                    valence: features?.valence || null,
                };
            });

            combinedData = [...combinedData, ...artistData];
        }

        return combinedData;
    } catch (error) {
        console.error('Error fetching data:', error);
    }
}

// Step 5: Save Data to CSV
async function saveToCsv(data, filename) {
    const csvWriter = createObjectCsvWriter({
        path: filename,
        header: [
            { id: 'artistName', title: 'Artist Name' },
            { id: 'trackName', title: 'Track Name' },
            { id: 'albumName', title: 'Album Name' },
            { id: 'durationMs', title: 'Duration (ms)' },
            { id: 'popularity', title: 'Popularity' },
            { id: 'explicit', title: 'Explicit' },
            { id: 'danceability', title: 'Danceability' },
            { id: 'energy', title: 'Energy' },
            { id: 'acousticness', title: 'Acousticness' },
            { id: 'instrumentalness', title: 'Instrumentalness' },
            { id: 'liveness', title: 'Liveness' },
            { id: 'loudness', title: 'Loudness' },
            { id: 'speechiness', title: 'Speechiness' },
            { id: 'tempo', title: 'Tempo' },
            { id: 'valence', title: 'Valence' },
        ],
    });

    await csvWriter.writeRecords(data);
    console.log(`Data saved to ${filename}`);
}
// Step 2: Get All Albums for an Artist
async function getAllAlbums(artistId, accessToken) {
    let albums = [];
    let url = `https://api.spotify.com/v1/artists/${artistId}/albums?limit=50&include_groups=album,single,compilation`;
    while (url) {
        const response = await fetch(url, {
            headers: {
                Authorization: `Bearer ${accessToken}`,
            },
        });
        const data = await response.json();
        albums = albums.concat(data.items);
        url = data.next; // Get the next page URL
    }
    return albums;
}

// Step 3: Get All Tracks for an Album
async function getAlbumTracks(albumId, accessToken) {
    let tracks = [];
    let url = `https://api.spotify.com/v1/albums/${albumId}/tracks?limit=50`;
    while (url) {
        const response = await fetch(url, {
            headers: {
                Authorization: `Bearer ${accessToken}`,
            },
        });
        const data = await response.json();
        tracks = tracks.concat(data.items);
        url = data.next; // Get the next page URL
    }
    return tracks;
}

// Step 4: Get Complete Discography
async function getCompleteDiscography(artistId) {
    try {
        const accessToken = await getAccessToken();

        console.log('Fetching albums...');
        const albums = await getAllAlbums(artistId, accessToken);

        console.log(`Found ${albums.length} albums. Fetching tracks...`);
        let allTracks = [];
        for (const album of albums) {
            const tracks = await getAlbumTracks(album.id, accessToken);
            tracks.forEach(track => {
                allTracks.push({
                    trackName: track.name,
                    albumName: album.name,
                    releaseDate: album.release_date,
                    trackNumber: track.track_number,
                    durationMs: track.duration_ms,
                    explicit: track.explicit,
                    id: track.id, // Track ID to handle duplicates
                });
            });
        }

        // Remove Duplicate Tracks
        const uniqueTracks = Array.from(new Map(allTracks.map(track => [track.id, track])).values());
        console.log(`Found ${uniqueTracks.length} unique tracks.`);

        return uniqueTracks;
    } catch (error) {
        console.error('Error fetching discography:', error);
    }
}



